package com.wenniuwuren.algorithm.lru.sort;

import java.util.HashMap;
import java.util.Map;

/**
 *
 * Given two strings s and t , write a function to determine if t is an anagram of s.
 *
 * Input: s = "anagram", t = "nagaram"
 * Output: true
 *
 * Input: s = "rat", t = "car"
 * Output: false
 */
public class Anagram {


    public boolean isAnagram(String s, String t) {
        Map<String, Integer> countMap1 = new HashMap<>();
        Map<String, Integer> countMap2 = new HashMap<>();

        for (int i = 0 ; i < s.length(); i++) {

            String key = s.charAt(i) + "";
            if (countMap1.containsKey(key)) {
                countMap1.put(key, countMap1.get(key) + 1);
            } else {
                countMap1.put(key, 0);
            }
        }

        for (int j = 0;  j < t.length(); j++) {
            String key = t.charAt(j) + "";

            if (countMap2.containsKey(key)) {
                countMap2.put(key, countMap2.get(key) + 1);
            } else {
                countMap2.put(key, 0);
            }
        }

        for (String key : countMap2.keySet()) {
            if (!countMap2.get(key).equals(countMap1.get(key))) {
                return false;
            }

        }

        for (String key : countMap1.keySet()) {
            if (!countMap1.get(key).equals(countMap2.get(key))) {
                return false;
            }

        }

        return true;

    }

    public static void main(String[] args) {
        Anagram anagram = new Anagram();
//        System.out.println(anagram.isAnagram("anagram" , "nagaram")); // true
//
//        System.out.println(anagram.isAnagram("rat" , "car")); // false
//
//        System.out.println(anagram.isAnagram("a" , "ab")); // false
//
//        System.out.println(anagram.isAnagram("aa" , "bb")); // false
//
//        System.out.println(anagram.isAnagram("ab" , "a")); // false

        System.out.println(anagram.isAnagram("",
            ""));
    }


}